CREATE DATABASE IF NOT EXISTS guild;
USE guild; 

-- ******************************************
-- define tables
-- ******************************************

CREATE TABLE IF NOT EXISTS user (
  `public_key`            CHAR(64) UNIQUE NOT NULL,
  `name`                  TEXT,
  `icon`                  MEDIUMTEXT,
  `created`               DATETIME
);

CREATE TABLE IF NOT EXISTS guild (
  `guild_id`              INT AUTO_INCREMENT UNIQUE NOT NULL PRIMARY KEY,
  `owner_public_key`      CHAR(64) NOT NULL,
  `name`                  TEXT,
  `icon`                  MEDIUMTEXT,
  `created`               DATETIME
);

CREATE TABLE IF NOT EXISTS quest (
  `quest_id`              INT AUTO_INCREMENT UNIQUE NOT NULL PRIMARY KEY,
  `nominate_guild_id`     INT,
  `transaction_hash`      TEXT,
  `title`                 TEXT,
  `description`           TEXT,
  `reward`                INT,
  `requester_public_key`  CHAR(64) NOT NULL,
  `worker_public_key`     CHAR(64),
  `status`                TEXT,
  `created`               DATETIME
);

CREATE TABLE IF NOT EXISTS notice (
  `notice_id`             INT AUTO_INCREMENT UNIQUE NOT NULL PRIMARY KEY,
  `public_key`            CHAR(64) NOT NULL,
  `title`                 TEXT,
  `body`                  TEXT,
  `created`               DATETIME
);

